const SeekerLogin = () => {
    return (
        <div className="seeker-application">
            <h2>Register as a Job Seeker</h2>
            <form action="">
                <label htmlFor="">Email</label>
                <input type="text" />
                <label htmlFor="">Password</label>
                <input type="text" />
                <button>Login</button>
            </form>
        </div>
    );
}
 
export default SeekerLogin;
